import Link from 'next/link';

export default function Index() {
  return (
    <div>

      <div class="home-head">

        <p id="about">ABOUT</p>

        <div class="home-title">
          <h1>Code <br /> Blue </h1>
        </div>

        <div class="home-text">
          <Link href="/menu">
            <a>ENTER</a>
          </Link>
        </div>

	  	</div>

      <style jsx>{`
        .home-head {
          overflow: hidden;
          top: 0;
          right: 0;
          background: cornflowerblue;
          display: block;
          width: 100vw;
          height: 100vh;
        }

        #about {
          float: right;
          padding: 25px;
          font-family: Montserrat;
          font-size: 100%;
        }

        .home-title { 
          float: left;
          text-align: left;
          padding-top: 10vh;
          margin-left: 100vw;
          height: 80%;
          padding-bottom: 5vh;
        }

        .home-text { 
          float: left;
          text-align: left;
          margin-left: 10vw;
          width: 80vw;
        } 

        h1 { 
          font-family: Raleway; 
          font-size: 800%;
        }

        a { 
          font-family: Montserrat; 
          font-size: 150%; 
          text-decoration: none;
        }      
      `}</style>

    </div>
  );
}
